/* eslint-disable react/forbid-prop-types */
import React from 'react';
import PropTypes from 'prop-types';

const Answer = ({ intro, features, types, conclusion }) => {
    return (
        <div className="p-4 text-left">
            <div>
                <h1 className="font-bold text-lg">Introdunction</h1>

                <p>{intro}</p>
            </div>
            <div>
                <h1 className="font-bold text-lg">Features</h1>
                <div>
                    {features.map((point) => {
                        return <li>{point}</li>;
                    })}
                </div>
            </div>
            {types && (
                <div>
                    <h1 className="font-bold text-lg">Types</h1>
                    {types.map((point) => {
                        return <li>{point}</li>;
                    })}
                </div>
            )}
            <div>
                <h1 className="font-bold text-lg">Conclusion</h1>
                <p>{conclusion}</p>
            </div>
        </div>
    );
};

Answer.propTypes = {
    intro: PropTypes.string.isRequired,
    features: PropTypes.array.isRequired,
    conclusion: PropTypes.string.isRequired,
    types: PropTypes.array,
};

Answer.defaultProps = {
    types: null,
};

export default Answer;
